SUM ELSE NULL END as SUM_CASH_IN,CASE WHEN frp.DOCSUM<0 AND wrtv.ID is NULL THEN -frp.DOCSUM ELSE NULL END as SUM_CASH_OUT,drrp.VALUE as CASH_IN_OUT_PURPOSE, frrp.NOTE as PURPOSE_NOTE,CASE WHEN frp.DOCSUM>0 AND NOT wrtv.ID is NULL THEN frp.DOCSUM ELSE NULL END as SUM_CASH_SALE,CASE WHEN frp.DOCSUM<0 AND NOT wrtv.ID is NULL THEN -frp.DOCSUM ELSE NULL END as SUM_CASH_RET_SALE FROM fin_retail_receipts m INNER JOIN fin_retail_payments frp ON frp.RETAIL_RECEIPT_ID=m.ID AND frp.PAYMENT_FORM_CODE=1 LEFT JOIN fin_retail_receipts_purposes frrp ON frrp.RETAIL_RECEIPT_ID=m.ID LEFT JOIN dir_retail_receipt_purposes drrp ON drrp.ID=frrp.RETAIL_RECEIPT_PURPOSE_ID LEFT JOIN wrh_retail_tickets_v wrtv ON wrtv.RETAIL_RECEIPT_ID=m.ID LEFT JOIN fin_retail_tickets_v frtp ON frtp.RETAIL_RECEIPT_ID=m.ID ORDER BY m.DOCDATE, m.NUMBER, wrtv.NUMBER','2017-10-27 15:30:34'),('fin_retail_receipts_purposes__1','2017-06-26 16:55:00','fin_retail_receipts_purposes','CREATE TABLE fin_retail_receipts_purposes(RETAIL_RECEIPT_ID BIGINT UNSIGNED NOT NULL PRIMARY KEY) CHARACTER SET utf8','2017-10-27 15:30:21'),('fin_retail_receipts_purposes__2','2017-06-26 16:56:00','fin_retail_receipts_purposes','ALTER TABLE fin_retail_receipts_purposes ADD COLUMN RETAIL_RECEIPT_PURPOSE_ID INTEGER NOT NULL','2017-10-27 15:30:22'),('fin_retail_receipts_purposes__3','2017-06-26 16:57:00','fin_retail_receipts_purposes','ALTER TABLE fin_retail_receipts_purposes ADD CONSTRAINT FIN_RETAIL_RECEIPTS_PURPOSES_R_R_PURPOSE_ID_FK FOREIGN KEY (RETAIL_RECEIPT_PURPOSE_ID) REFERENCES dir_retail_receipt_purposes(ID)','2017-10-27 15:30:22'),('fin_retail_receipts_purposes__4','2017-06-26 16:58:00','fin_retail_receipts_purposes','ALTER TABLE fin_retail_receipts_purposes ADD COLUMN NOTE VARCHAR(255) NOT NULL','2017-10-27 15:30:22'),('fin_retail_receipts__1','2016-09-26 21:01:00','fin_retail_receipts','CREATE TABLE fin_retail_receipts(ID BIGINT UNSIGNED NOT NULL PRIMARY KEY) CHARACTER SET utf8','2017-10-27 15:29:39'),('fin_retail_receipts__2',