CDATE, wrtv.NUMBER, m.POS, m.PRODUCT_ID, m.QTY, m.SALE_PRICE, m.DISCOUNT, m.PRICE, m.POSSUM,\nCASE WHEN m.QTY>0 THEN m.QTY ELSE 0 END as SALE_QTY, CASE WHEN m.QTY<0 THEN -m.QTY ELSE 0 END as RET_SALE_QTY,\nCASE WHEN m.QTY>0 THEN m.POSSUM ELSE 0 END as SALE_POSSUM, CASE WHEN m.QTY<0 THEN -m.POSSUM ELSE 0 END as RET_SALE_POSSUM,\nwrtv.DOCSUM, \nfrtp.PAYSUM, frp.PAYMENT_FORM_CODE,\nCASE WHEN frp.PAYMENT_FORM_CODE=1 AND wrtv.DOCSUM<>0 THEN COALESCE(SUM(frp.DOCSUM),0)*m.POSSUM/wrtv.DOCSUM END as CASH_SUM,\nCASE WHEN frp.PAYMENT_FORM_CODE=2 AND wrtv.DOCSUM<>0 THEN COALESCE(SUM(frp.DOCSUM),0)*m.POSSUM/wrtv.DOCSUM END as CARD_SUM, \nCASE WHEN m.QTY>0 AND frp.PAYMENT_FORM_CODE=1 AND wrtv.DOCSUM<>0 THEN COALESCE(SUM(frp.DOCSUM),0)*m.POSSUM/wrtv.DOCSUM ELSE 0 END as SALE_CASH_SUM,\nCASE WHEN m.QTY>0 AND frp.PAYMENT_FORM_CODE=2 AND wrtv.DOCSUM<>0 THEN COALESCE(SUM(frp.DOCSUM),0)*m.POSSUM/wrtv.DOCSUM ELSE 0 END as SALE_CARD_SUM,\nCASE WHEN m.QTY<0 AND frp.PAYMENT_FORM_CODE=1 AND wrtv.DOCSUM<>0 THEN COALESCE(SUM(-frp.DOCSUM),0)*m.POSSUM/wrtv.DOCSUM ELSE 0 END as RET_SALE_CASH_SUM,\nCASE WHEN m.QTY<0 AND frp.PAYMENT_FORM_CODE=2 AND wrtv.DOCSUM<>0 THEN COALESCE(SUM(-frp.DOCSUM),0)*m.POSSUM/wrtv.DOCSUM ELSE 0 END as RET_SALE_CARD_SUM \nFROM wrh_retail_tickets_products m \nINNER JOIN wrh_retail_tickets_v wrtv ON wrtv.ID=m.RETAIL_TICKET_ID \nINNER JOIN fin_retail_tickets_v frtp ON frtp.ID=m.RETAIL_TICKET_ID \nLEFT JOIN fin_retail_payments frp ON frp.RETAIL_RECEIPT_ID=frtp.RETAIL_RECEIPT_ID \nGROUP BY m.ID, m.RETAIL_TICKET_ID, wrtv.RETAIL_RECEIPT_ID, wrtv.DOCDATE, wrtv.NUMBER, \nm.POS, m.PRODUCT_ID, m.QTY, m.SALE_PRICE, m.DISCOUNT, m.PRICE, m.POSSUM,\nwrtv.DOCSUM, frtp.PAYSUM, frp.PAYMENT_FORM_CODE \nORDER BY wrtv.DOCDATE, wrtv.NUMBER, m.POS','2017-10-27 15:30:34'),('fin_retail_tickets_v__1','2017-10-09 14:30:00','fin_retail_tickets_v','CREATE VIEW fin_retail_tickets_v\n(ID, RETAIL_RECEIPT_ID, UNIT_ID, DOCDATE, NUMBER, BUYER_ID, CURRENCY_ID, RATE, DOCSTATE_ID, PAYCOUNT, PAYSUM)AS \nSELECT m.ID, m.RETAIL_RECEIPT_ID, m.UNIT_ID, m.DOCDATE, m.NUMBER, m.BUYER_ID, m.CURRENCY_ID, m.RATE, m.DOCSTATE_ID,\nCOALESCE(SUM(CASE WHEN Not mp.ID is NULL THEn 1 ELSE 0 END),0) as PAYCOUNT,\nCOALESCE(SUM(mp.DOCSUM),0) as PAYSUM \nFROM wrh_retail_tickets m \nINNER JOIN fin_retail_receipts mr ON mr.ID = m.RETAIL_RECEIPT_ID \nLEFT JOIN fin_retail_payments mp ON mp.RETAIL_RECEIPT_ID=mr.ID \nGROUP BY m.ID, m.RETAIL_RECEIPT_ID, m.UNIT_ID, m.DOCDATE, m.NUMBER, m.BUYER_ID, m.CURRENCY_ID, m.RATE, m.DOCSTATE_ID \nORDER BY m.UNIT_ID, m.DOCDATE, m.NUMBER','2017-10-27 15:30:33'),('sys_currency_10','2016-08-30 09:54:00','sys_currency','INSERT INTO sys_currency(ID,CODE,NAME,NOTE) values(3,\'RUB\',\'Российский рубль\',\'Российский рубль\')','2017-10-27 15:24:47'),('sys_currency_11','2016-08-30 09:55:00','sys_currency','INSERT INTO sys_currency(ID,CODE,NAME,NOTE) values(4,\'GBR\',\'Английский фунт стерлингов\',\'Английский фунт стерлингов\')','2017-10-27 15:24:47'),('sys_currency__1','2016-08-30 09:41:00','sys_currency','CREATE TABLE sys_currency(ID INTEGER UNSIGNED NOT NULL PRIMARY KEY) CHARACTER SET utf8','2017-10-27 15:24:44'),('sys_currency__2','2016-08-30 09:42:00','sys_currency','ALTER TABLE sys_currency ADD COLUMN CODE VARCHAR(3) NOT NULL','2017-10-27 15:24:45'),('sys_currency__3','2016-08-30 09:43:00','sys_currency','ALTER TABLE sys_currency ADD CONSTRAINT SYS_CURRENCY_ALIAS_UNIQUE UNIQUE(CODE)','2017-10-27 15:24:45'),('sys_currency__4','2016-08-30 09:44:00','sys_currency','ALTER TABLE sys_currency ADD COLUMN NAME VARCHAR(50) NOT NULL','2017-10-27 15:24:45'),('sys_currency__5','2016-08-30 09:45:00','sys_currency','ALTER TABLE sys_currency ADD CONSTRAINT SYS_CURRENCY_NAME_UNIQUE UNIQUE(NAME)','2017-10-27 15:24:46'),('sys_currency__6','2016-08-30 09:46:00','sys_currency','ALTER TABLE sys_currency ADD COLUMN NOTE VARCHAR(255) NOT NULL','2017-10-27 15:24:46'),('sys_currency__7','2016-08-30 09:51:00','sys_currency','INSERT INTO sys_currency(ID,CODE,NAME,NOTE) values(0,\'UAH\',\'У