KEY (DOCSTATE_ID) REFERENCES sys_docstates(ID)','2017-10-27 15:25:11'),('wrh_pinvs__7','2016-09-07 10:07:00','wrh_pinvs','ALTER TABLE wrh_pinvs ADD COLUMN CURRENCY_ID INTEGER UNSIGNED NOT NULL','2017-10-27 15:25:11'),('wrh_pinvs__8','2016-09-07 10:08:00','wrh_pinvs','ALTER TABLE wrh_pinvs ADD CONSTRAINT WRH_PINVS_CURRENCY_ID_FK FOREIGN KEY (CURRENCY_ID) REFERENCES sys_currency(ID)','2017-10-27 15:25:11'),('wrh_pinvs__9','2016-09-07 10:09:00','wrh_pinvs','ALTER TABLE wrh_pinvs ADD COLUMN RATE DECIMAL(10,2) NOT NULL','2017-10-27 15:25:12'),('wrh_products_operations_v_v__1','2017-10-16 09:00:00','wrh_products_operations_v','CREATE VIEW wrh_products_operations_v(PRODUCT_ID, UNIT_ID, DOCCODE, DOCDATE, DOCNUMBER, DOCPOSIND, DOCOPERID, DOCQTY, BATCH_NUMBER, BATCH_QTY) AS\nSELECT wpip.PRODUCT_ID, wpi.UNIT_ID, 10 as DOCCODE, wpi.DOCDATE, wpi.NUMBER, wpip.POSIND, wpip.ID, wpip.QTY, wpip.BATCH_NUMBER, wpip.QTY\nFROM wrh_pinvs_products wpip\nINNER JOIN wrh_pinvs wpi ON wpi.ID=wpip.PINV_ID\nINNER JOIN dir_products_batches dpb ON dpb.PRODUCT_ID=wpip.PRODUCT_ID AND dpb.BATCH_NUMBER=wpip.BATCH_NUMBER\nUNION ALL\nSELECT wip.PRODUCT_ID, wi.UNIT_ID, 80 as DOCCODE, wi.DOCDATE, wi.NUMBER, wip.POSIND, wip.ID, wip.QTY,\nCASE When wipb.BATCH_NUMBER is NULL Then SIGN(0) Else wipb.BATCH_NUMBER END,\nCASE When wipb.BATCH_NUMBER is NULL Then -wip.QTY Else -wipb.BATCH_QTY END\nFROM wrh_invs_products wip\nINNER JOIN wrh_invs wi ON wi.ID=wip.INV_ID\nLEFT JOIN wrh_invs_products_wob wipb ON wipb.INVS_PRODUCTS_ID=wip.ID\nLEFT JOIN dir_products_batches dpb ON dpb.PRODUCT_ID=wip.PRODUCT_ID AND dpb.BATCH_NUMBER=wipb.BATCH_NUMBER\nUNION ALL\nSELECT wrip.PRODUCT_ID, wri.UNIT_ID, 20 as DOCCODE, wri.DOCDATE, wri.NUMBER, wrip.POSIND, wrip.ID, wrip.QTY,\nCASE When wripb.BATCH_NUMBER is NULL Then SIGN(0) Else wripb.BATCH_NUMBER END,\nCASE When wripb.BATCH_NUMBER is NULL Then wrip.QTY Else wripb.BATCH_QTY END\nFROM wrh_ret_invs_products wrip\nINNER JOIN wrh_ret_invs wri ON wri.ID=wrip.RET_INV_ID\nLEFT JOIN wrh_ret_invs_products_wob wripb ON wripb.RET_INVS_PRODUCTS_ID=wrip.ID\nLEFT JOIN dir_products_batches dpb ON dpb.PRODUCT_ID=wrip.PRODUCT_ID AND dpb.BATCH_NUMBER=wripb.BATCH_NUMBER\nUNION ALL\nSELECT wrtp.PRODUCT_ID, wrt.UNIT_ID, 90 as DOCCODE, wrt.DOCDATE, wrt.NUMBER, wrtp.POS+1, wrtp.ID, wrtp.QTY,\nCASE When dpb.BATCH_NUMBER is NULL Then SIGN(0) Else wrtpw.BATCH_NUMBER END,\nCASE When dpb.BATCH_NUMBER is NULL Then -wrtp.QTY Else 0 -wrtpw.BATCH_QTY END\nFROM wrh_retail_tickets_products wrtp\nINNER JOIN wrh_retail_tickets wrt ON wrt.ID=wrtp.RETAIL_TICKET_ID\nLEFT JOIN wrh_retail_tickets_products_wob wrtpw ON wrtpw.RETAIL_TICKETS_PRODUCTS_ID=wrtp.ID\nLEFT JOIN dir_products_batches dpb ON dpb.PRODUCT_ID=wrtp.PRODUCT_ID AND dpb.BATCH_NUMBER=wrtpw.BATCH_NUMBER\nWHERE wrtp.QTY>=0\nUNION ALL\nSELECT wrtp.PRODUCT_ID, wrt.UNIT_ID, 40 as DOCCODE, wrt.DOCDATE, wrt.NUMBER, wrtp.POS+1, wrtp.ID, wrtp.QTY,\nCASE When dpb.BATCH_NUMBER is NULL Then SIGN(0) Else wrtpw.BATCH_NUMBER END,\nCASE When dpb.BATCH_NUMBER is NULL Then -wrtp.QTY Else -wrtpw.BATCH_QTY END\nFROM wrh_retail_tickets_products wrtp\nINNER JOIN wrh_retail_tickets wrt ON wrt.ID=wrtp.RETAIL_TICKET_ID\nLEFT JOIN wrh_retail_tickets_products_wob wrtpw ON wrtpw.RETAIL_TICKETS_PRODUCTS_ID=wrtp.ID\nLEFT JOIN dir_products_batches dpb ON dpb.PRODUCT_ID=wrtp.PRODUCT_ID AND dpb.BATCH_NUMBER=wrtpw.BATCH_NUMBER\nWHERE wrtp.QTY<0\n','2017-10-27 15:30:34'),('wrh_products_r_operations__1','2017-06-09 11:10:00','wrh_products_r_operations','CREATE TABLE wrh_products_r_operations(OPERATION_ID BIGINT UNSIGNED NOT NULL) CHARACTER SET utf8','2017-10-27 15:30:12'),('wrh_products_r_operations__2','2017-06-09 11:11:00','wrh_products_r_operations','ALTER TABLE wrh_products_r_operations ADD CONSTRAINT WRH_PRODUCTS_R_OPERATIONS_OPERATION_ID_FK FOREIGN KEY (OPERATION_ID) REFERENCES sys_operations(ID)','2017-10-27 15:30:13'),('wrh_products_r_operations__3','2017-06-09 11:12:00','wrh_products_r_operations','ALTER TABLE wrh_products_r_operations ADD CO